export const COLUMNS = [
    {
        Header: 'Name',
        accessor: 'name',        
        disableSortBy: true        
    },
    {
        Header: 'Description',
        accessor: 'description',
        disableSortBy: true
    },
    {
        Header: 'Initial price',
        accessor: 'initial_price',
        disableGlobalFilter: true
    },
    {
        Header: 'Actual bind',
        accessor: 'last_bind',
        disableGlobalFilter: true,
    },
    {
        Header: 'User',
        accessor: 'last_bind_user',
        disableSortBy: true,
        disableGlobalFilter: true,
    }
]
